import React from 'react';
import { motion } from 'framer-motion';
import { Routes, Route, Link } from 'react-router-dom';
import Team from './Team';                    // src/Team.jsx
import ServiceIntro from './ServiceIntro';    // 서비스 소개 컴포넌트
import Analysis_Content from './Analysis_Content';  // 내용 분석 페이지 컴포넌트
import Analysis_Voice from './Analysis_Voice';      // 음성 분석 페이지 컴포넌트
import Analysis_Video from './Analysis_Video';      // 영상 분석 페이지 컴포넌트

export default function App() {
  const orbColors = ['#826BC6', '#5686C4', '#3EB489'];
  const orbs = Array.from({ length: 10 }).map((_, i) => {
    const size = Math.random() * 12 + 8;
    const color = orbColors[i % orbColors.length];
    const leftPercent = Math.random() * 100;
    const topPercent = Math.random() * 80 + 15;
    const offset = 50;
    const animateX = Math.random() * offset * 2 - offset;
    const animateY = Math.random() * offset * 2 - offset;
    const duration = Math.random() * 5 + 5;
    return (
      <motion.div
        key={i}
        className="absolute rounded-full"
        style={{
          width: size,
          height: size,
          backgroundColor: color,
          left: `${leftPercent}%`,
          top: `${topPercent}%`,
          opacity: 0.5,
          filter: 'drop-shadow(0 0 5px rgba(0,0,0,0.2))',
        }}
        animate={{ x: animateX, y: animateY, opacity: 0.5 }}
        transition={{ repeat: Infinity, repeatType: 'mirror', duration, ease: 'easeInOut' }}
      />
    );
  });

  return (
    <div className="relative flex flex-col min-h-screen font-sans overflow-hidden">
      {/* Full-screen orbs */}
      {orbs}

      {/* Header */}
      <header className="relative z-20 container mx-auto flex justify-between items-center px-8 py-4">
        <div className="flex items-center space-x-2 mt-2">
          <img src="/assets/logo.png" alt="PitchPal" className="h-8" />
          <span className="text-2xl font-bold text-black">PitchPal</span>
        </div>
        <nav className="flex items-center space-x-6 text-gray-700">
          <Link to="/" className="hover:text-blue-900">홈</Link>
          <Link to="/services" className="hover:text-blue-900">서비스 소개</Link>
          <Link to="/content-analysis" className="hover:text-blue-900">내용 분석</Link>
          <Link to="/voice-analysis" className="hover:text-blue-900">음성 분석</Link>
          <Link to="/video-analysis" className="hover:text-blue-900">영상 분석</Link>
          {/* 시각적으로 숨김 처리 */}
          <Link to="/team" className="invisible hover:text-blue-900">팀원 소개</Link>
          <a
            href="https://github.com/haeyeon0123/PitchPal.git"
            target="_blank"
            rel="noopener noreferrer"
            className="invisible hover:text-blue-900"
          >
            History
          </a>
        </nav>
      </header>

      {/* Gradient underline */}
      <div className="w-full h-6 bg-gradient-to-b from-gray-100 to-transparent z-10" />

      {/* Routes */}
      <Routes>
        {/* 메인 화면 */}
        <Route
          path="/"
          element={
            <>
              {/* 기존 메인 페이지 요소 유지 */}
            </>
          }
        />
        {/* 서비스 소개 페이지 */}
        <Route path="/services" element={<ServiceIntro />} />
        {/* 분석 페이지 */}
        <Route path="/content-analysis" element={<Analysis_Content />} />
        <Route path="/voice-analysis" element={<Analysis_Voice />} />
        <Route path="/video-analysis" element={<Analysis_Video />} />
        {/* 팀원 소개 페이지 */}
        <Route path="/team" element={<Team />} />
      </Routes>
    </div>
  );
}
